import React, { useState } from "react";
import "./Home.scss";
import Navbar from "../components/Layout/Navbar";
import HiddenSearchBar from "../components/Layout/HiddenSearchBar";

const HomePage = () => {
  const [searchContainerHeight, setSearchContainerHeight] = useState(); // State variable for container height
  const [searchContainerColor, setSearchContainerColor] = useState(); // State variable for container color

  return (
    <div
      className="home-container"
      style={{
        height: searchContainerHeight,
        backgroundColor: searchContainerColor,
      }}
    >
      <HiddenSearchBar
        setSearchContainerHeight={setSearchContainerHeight}
        setSearchContainerColor={setSearchContainerColor}
      />
      <Navbar />
    </div>
  );
};

export default HomePage;
